import Header from './header';

function login() {
  return (
    <div className='relative w-screen h-screen'>
      <Header />
      <div className='absolute inset-0'>
        <img className='brightness-80 w-full h-full object-cover' src='./images/background.png' alt='Background anime wallpaper' />
      </div>
    </div>
  )
}

export default login
